import React from "react";

function Description() {
  return (
    <React.Fragment>
      <h3>
        "Forgot your umbrella or didn’t dress for it?Never forget about rain
        again!"
      </h3>
      <h4>
        "Get a text message on your phone if it’s expected to rain in your city"
      </h4>
    </React.Fragment>
  );
}

export default Description;
